__NUXT_JSONP__("/drugs/Ombrabulin", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"181816-48-8",chebiId:"",chemicalFormula:"C21H26N2O6",definition:"A synthetic water-soluble analogue of combretastatin A4, derived from the South African willow bush (Combretum caffrum), with potential vascular-disrupting and antineoplastic activities. Ombrabulin binds to the colchicine binding site of endothelial cell tubulin, inhibiting tubulin polymerization and inducing mitotic arrest and apoptosis in endothelial cells. As apoptotic endothelial cells detach from their substrata, tumor blood vessels collapse; the acute disruption of tumor blood flow may result in tumor necrosis.",fdaUniiCode:"82JB1524Q6",identifier:"C78480",preferredName:a,semanticType:"Organic Chemical",subclassOf:["C67421"],synonyms:["(2S)-2-amino-3-hydroxy-n-(2-methoxy-5-((1Z)-2-(3,4,5-trimethoxyphenyl)ethenyl)phenyl)propanamide","AC7700","AVE8062","Combretastatin A4 Analogue AVE8062","OMBRABULIN",a]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FOmbrabulin",extension:".json",createdAt:b,updatedAt:b}}],fetch:{},mutations:void 0}}("Ombrabulin","2021-10-30T13:45:13.593Z")));